import { Swith, Route } from 'react-router-dom';
import { Produtos } from './Paginas/Produtos.js';
import { Pedidos } from './Paginas/Pedidos.js';


function Rotas() {
    retorn(
        <Swith>
            <Route exact path="/" component={ Produtos } />
            <Route exact path="/edidos" component={ Pedidos } />
        </Swith>
    );
}

export default Rotas;
